import React from 'react'
import image1 from '../assets/team.svg'
const Form = () => {
  return (
    <div className='flex gap-5 justify-center'>
     <div>
        <img src={image1} alt='Conatct'/>
     </div>
     <div></div>
    </div>
  )
}

export default Form
